import React from 'react'
import { Tab } from 'semantic-ui-react'
import { makeStyles } from '@material-ui/core/styles';
// const panes = [
//   { menuItem: 'Tab 1', render: () => <Tab.Pane>Tab 1 Content</Tab.Pane> },
//   { menuItem: 'Tab 2', render: () => <Tab.Pane>Tab 2 Content</Tab.Pane> },
//   { menuItem: 'Tab 3', render: () => <Tab.Pane>Tab 3 Content</Tab.Pane> },
// ]
const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
    backgroundColor: theme.palette.background.paper,
    display: 'flex',
    height: 224,
  },
  tabs: {
    borderRight: `1px solid ${theme.palette.divider}`,
  },
}));

// {data.map((k, v) => <Tab key={k.key} menu={{ fluid: true, vertical: true, tabular: true }} panes={k} />)}
export default function TabExampleVerticalTabular (props){
	const classes = useStyles();
	// console.log(props)
	const data = props.assets
	// data.map((k, v)=> console.log('KEY:', k, 'V.KEY:',v.key, 'V:',v))
  return (
  	<div className={classes.root}>                           
  		<Tab className={classes.tabs} panes={data} menu={{ fluid: true, vertical: true, tabular: true }} renderActiveOnly={false} />
  	</div>
  	)
}
